  // nieuwe array met enkelen namen en vervolgens map hieronder
  return (
    <div class="text">
      {data.map((props) => (
        <h1 key={props.id}>
          <Link to={`/Students/${props.Name}`}>{props.Name}</Link>
        </h1>
      ))}
    </div>
  );
}
export default StudentContainer;
